		SlideShowPlayerAPI.prototype.HandleHandshakeMessage = function (handshakeMessage) {
			if (this.m_handshakeReceived) {
				if (this.m_logger)
					this.m_logger.ULS.traceTag(0x226d7685, logCategory.PptSession, logLevel.Error, "Duplicate HandshakeMessage received: " + this.m_id + ", handshakeMessage:" + handshakeMessage);
				return;
			}
			this.m_handshakeReceived = true;
			if (this.m_logger) {
				this.m_logger.ULS.traceTag(0x226d7684, logCategory.PptSession, this.m_id == handshakeMessage.m_id ? logLevel.Info : logLevel.Error, "HandleHandshakeMessage: m_id:" + this.m_id + ", handshakeMessage.m_id:" + handshakeMessage.m_id);
			}
			if (handshakeMessage.m_id && handshakeMessage.m_fEnableKeyboardNavigation != null) {
				PPTe.BootTiming.RecordBootTiming("ReceivedHandshakeFromAPI", new Date().getTime(), null);
				this.m_id = handshakeMessage.m_id;
				if (this.m_app) {
					this.m_app.get_SessionActivity().RecordHandshakeData(handshakeMessage);
					this.m_app.SetEnableKeyboardNavigation(handshakeMessage.m_fEnableKeyboardNavigation);
					this.m_app.OnRecievedContentMetadataFromApi(handshakeMessage.m_contentMetadata);
					this.m_app.set_FAdvanceOnTap(handshakeMessage.m_fEnableAdvanceOnTap);
					this.m_handshakeConditional.SetCondition(this.c_handshakeStartedCondition);
					this.m_app.setDisabledTransitions(handshakeMessage.m_disabledTransitionsList);
					this.m_app.setCustomTransitionResourceUrl(handshakeMessage.m_customTransitionResourceUrl);
					this.m_app.setStreamUseThinEmbed(handshakeMessage.m_streamUseThinEmbed);
					this.m_app.setAreThirdPartyAddInsAllowed(handshakeMessage.m_areThirdPartyAddInsAllowed);
					this.m_app.setAllowExternalMarketplace(handshakeMessage.m_allowExternalMarketplace);
				}
				for (var iQueuedError = 0; iQueuedError < this.m_queuedErrors.length; ++iQueuedError) {
					var errorContents = this.m_queuedErrors[iQueuedError];
					this.SendError(errorContents.Code, errorContents.ErrorName, errorContents.Message, errorContents.ExtraInfo, errorContents.CorrelationId);
				}
				if (!this.m_app)
					return;
				var vetoAppSettingsStr = handshakeMessage.m_vetoAppSettingsStr || "";
				this.m_app.OnApiReady(handshakeMessage.m_fileUrl, handshakeMessage.m_fileSize, handshakeMessage.m_fileName, handshakeMessage.m_presentationId, handshakeMessage.m_startingSlideId, handshakeMessage.m_startingSlideIndex, vetoAppSettingsStr, handshakeMessage.m_disabledChangeGates);
				if (this.FStartPreview(handshakeMessage.m_startingSlideIndex)) {
					this.StartPreview(handshakeMessage.m_presentationId, handshakeMessage.m_startingSlideIndex);
				}
			}
			else {
				this.m_logger.ULS.traceTag(0x0258e448, logCategory.PptSession, logLevel.Error, "Invalid HandshakeMessage received");
			}
		};

		SlideShowPlayerAPI.prototype.HandleMessage = function (data) {
			this.m_logger.ULS.traceTag(0x23517692, logCategory.PptSession, logLevel.Info, "Received Message for API :" + data.m_type);
			this.m_lastOnPositionChangedMessageDuringHandleMessage = null;
			this.m_fHandlingInternalMessage = true;
			switch (data.m_type) {
				case SlideShowPlayerInternalMessageType.Handshake:
					{
						var handshakeMessage = data;
						this.HandleHandshakeMessage(handshakeMessage);

					}

						var getSlidesInShowCountResponse = { m_id: this.m_id, m_type: SlideShowPlayerExternalMessageType.GetSlidesInShowCount, m_slidesCount: this.m_app.GetSlidesInShowCount() };
						this.PostMessageUpward(getSlidesInShowCountResponse);

					}

					{
						var getBuildStepsCountWebViewerInternalMessage = data;
						this.HandleGetTimelineInfosMessage(getBuildStepsCountWebViewerInternalMessage);

				case SlideShowPlayerInternalMessageType.GetCurrentPosition:
					{
						this.HandleGetCurrentPositionMessage();
						break;
					}

					{
						this.HandleGetCurrentPositionWithTimeLinesMessage();
						break;
					}

					{

					}

					}

					{
						var getPresentationPlaybackStateResponse = { m_id: this.m_id, m_type: SlideShowPlayerExternalMessageType.GetPresentationPlaybackState, m_playbackState: this.m_app.GetPresentationPlaybackState() };
						this.PostMessageUpward(getPresentationPlaybackStateResponse);
						break;
					}
				case SlideShowPlayerInternalMessageType.NextSlide:
					{
						this.m_app.ObjectModelNextSlide();
						break;
					}
				case SlideShowPlayerInternalMessageType.Prev:
					{

					}

						this.m_app.ObjectModelGoToNextSlide();

					}

					{
						var goToSlideWebViewerInternalMessage = data;

					{
						var goToSlideIdWebViewerInternalMessage = data;
						if (isUintValid(goToSlideIdWebViewerInternalMessage.m_slideId) && goToSlideIdWebViewerInternalMessage.m_timeLineMappings != null) {
